(5, 2, 0, 0, 804, 786, 'Start Digital Marketing', 'facebook, linkedin in consultation with Ranjit', 1, 0, 0, '2019-03-04 01:22:40', '2019-03-08 12:00:00', '0000-00-00 00:00:00', NULL, NULL, NULL, 1, 0, 0, 0, 'Digital Marketing', 0, 0, '1.00', '2019-03-04 19:22:40', '2019-03-05 21:38:57'),
(7, 2, 0, 0, 804, 786, 'Changes in Rolling Access', 'Remove Mr/Ms Salutation\r\nThere should be dropdown for project name once input is done\r\nSub task should be there in task form (For example Make changes in Rolling Access is main task and subtasks are mentioned like this)\r\nThere should be additional column of \"Thumbs Up/down\" to mark outstanding performance or negligence apart from KPIs or tasks. \r\nEvery month the KPI should be given red, yellow, green colour to mark not met, almost there or met. \r\nReal time performance dashboard should be displayed. For example a pie chart of completed, over due or not completed task, a bar chart of rating of 10, KPI achievement on target or not\r\nMultiple task is not being submitted\r\nNext tab after help desk should be \"Self Task\" where staff can input their own work\r\nWhenever any task is assigned to somebody, his/her other tasks should also be displayed\r\nThe whole task list doesn\'t show who assigned to him\r\nPlacing of \"Not Accepted\" text is not proper. Please work on it. \r\nJob addition notification should be displayed, sub task deadline, completion should be there, attachment should be there......\r\nAfter \"Assign\" it is logging out. Please solve this. ', 1, 0, 0, '2019-03-04 01:24:29', '2019-03-15 00:00:00', '0000-00-00 00:00:00', NULL, NULL, NULL, 1, 0, 0, 116, 'Rolling Access', 0, 0, '1.00', '2019-03-04 19:24:29', '2019-03-11 23:11:24'),
(8, 2, 0, 0, 800, 786, 'Skill upload of all staffs', 'Upload all skills in Rolling Access for all staff', 1, 1, 1, '2019-03-04 01:32:11', '2019-03-08 12:00:00', '0000-00-00 00:00:00', '2019-03-08 13:18:04', '19 core staffs\' skills have been uploaded in their Rolling Access dashboard.', 'Well done though a little late', 1, 7, 8, 82, 'Rolling Access', 0, 0, '1.00', '2019-03-04 19:32:11', '2019-03-08 21:07:22'),
(9, 2, 0, 0, 800, 786, 'AMCAT related work', 'Get Mou from client or make yourself\r\nList all possible companies and colleges\r\nArrange presentation in atleast one college\r\nMake video of AMCAT testimonial\r\nUpload in fb\r\nMake payment\r\nMake ppt file, brochure and flyer ready. Even of the pricing\r\nConduct AMCAT for our new joinees as well\r\nFind out exhibitions/programs where we can put our stall\r\n\r\n', 1, 0, 0, '2019-03-04 01:38:56', '2019-06-30 00:00:00', '0000-00-00 00:00:00', '2019-05-30 11:34:24', 'I have prepared all the required files and we are now ready to approach the market for amcat....', 'undefined', 1, 7, 0, 82, 'Rollinamcat', 0, 0, '1.00', '2019-03-04 19:38:56', '2019-05-30 08:33:17'),
