(4, 70, 786, 783, 'This is the one', NULL, 1, '2019-03-05 19:24:50', '2019-03-05 19:25:17'),
(5, 69, 786, 815, '', 'staffs/chat/1794976633.jpeg', 1, '2019-03-05 19:29:24', '2019-03-15 16:26:53'),
(6, 69, 786, 815, 'According to the above', NULL, 1, '2019-03-05 19:29:36', '2019-03-15 16:26:53'),
(7, 66, 783, 786, '', 'staffs/chat/926375422.pdf', 1, '2019-03-05 19:32:45', '2019-03-05 19:35:14'),
(8, 66, 783, 786, 'Drafted Agreement paper for Medtronics , regarding the 25% government tax is mentioned on page one ', NULL, 1, '2019-03-05 19:33:51', '2019-03-05 19:35:14'),
(9, 66, 783, 786, 'Dear Gyan,  Tried calling you up. We discussed with our local finance team. We will go with Module 2 mentioned in your trailing email below:  1)	You will bill us separately or generate a single bill for both the below items in Module 2  i.e. i)	Local Staff Outsourcing Module that includes onboarding management, contract management , payroll management and compliance management and  ii)	Other expenses could be done through issuing the VAT invoice by  adding and including the 25% Government Income Tax applicable on the actual expense amount.   2)	The Contract/Proposal between Rolling Plans and India Medtronic Private Ltd may be prepared and sent over for signature.   3)	The Business will share the Purchase Order Number basis the contract which will be used for the entire year. The PO Number must be mentioned in the invoice.  4)	The Invoices and supporting documents is to be sent to the relevant co-ordinator who will co-ordinate with Finance to have the same processed.   Thanks, Best Reg', NULL, 1, '2019-03-05 19:36:48', '2019-03-05 19:37:01'),
(10, 66, 786, 783, 'Till when will it be implemented?', NULL, 1, '2019-03-05 19:37:48', '2019-03-05 19:38:03'),
(11, 66, 783, 786, 'March 1, 2019 till Feb 29, 2020', NULL, 1, '2019-03-05 19:38:31', '2019-03-05 19:41:40'),
(12, 66, 786, 783, 'See the job associated with it by clicking   button', NULL, 1, '2019-03-05 19:41:57', '2019-03-05 19:42:02'),
(13, 66, 786, 783, 'hi', NULL, 1, '2019-03-05 19:43:04', '2019-03-05 19:43:34'),
(14, 7, 804, 786, 'This all the task could not finish on 5th of March, it will take 8th of March', NULL, 1, '2019-03-05 21:38:26', '2019-03-05 23:28:38'),
(15, 40, 789, 786, 'Talked with shaman Ji, They will call us for final meeting once they finalize their own internal meetings regarding contract renewal.', NULL, 1, '2019-03-05 22:07:28', '2019-03-06 18:11:57'),
(16, 16, 786, 804, 'Done', NULL, 1, '2019-03-05 23:28:30', '2019-03-06 15:10:12'),
(17, 7, 786, 804, 'ok', NULL, 1, '2019-03-05 23:28:49', '2019-03-06 15:10:01'),
(18, 12, 805, 786, 'Dear Sir, I think we cannot decide the Interview date for CFO by today and eventually the hall booking part. Therefore, I kindly request you to extend the deadline atleast by 5 days for these two subtasks.', NULL, 1, '2019-03-06 16:12:58', '2019-03-07 18:28:39'),
(19, 53, 805, 783, 'Dear Sir, the candidate for samsung is still going through the selection process and might take a day or two for the final decision and onboarding him in the floor.', NULL, 1, '2019-03-06 16:14:13', '2019-03-06 19:32:59'),
(20, 54, 805, 783, 'Dear sir, I would like to request you to extend the deadline for shortlisting the CFO as the number of candidates are huge and we have decided a manual review for every CVs. Therefore , this shall take minimum a week sir. Thank you for your consideration.', NULL, 1, '2019-03-06 16:15:49', '2019-03-07 16:25:39'),
(21, 56, 805, 783, 'Dear sir, I kindly request you to extend the deadline for this task. As we have extended the deadline for all the positions of a leading tv network due to poor applicants flow. So this might take 15 to 20 days more for the final shortlist. Please accept my kind regards.', NULL, 1, '2019-03-06 16:17:40', '2019-03-06 19:31:13'),
(22, 83, 816, 786, '6 days lagcha sir', NULL, 1, '2019-03-06 16:37:55', '2019-03-06 16:38:06'),
(23, 83, 786, 816, 'Ok but I want you to do within 6 days . No more excuse', NULL, 1, '2019-03-06 16:38:23', '2019-03-06 16:38:26'),
(24, 95, 783, 786, 'Good Morning sir', NULL, 1, '2019-03-06 18:00:42', '2019-03-06 19:45:52'),
