(52, 126, 'About company and Salary:  Polaris is a 20 years old cleaning company with more than 9 cities contract namely Constanta, Targu Jiu, Navodari, Mangalia, Alba Iulia, Bumbesti Jiu, Slobozia, as well as in Teleorman and Timis counties. The cleaners will work in Constanta city. There are total 2000 staffs in company. www.polaris.ro. The salary is 400 Euro for 9 hours X 26 days. 500 Euro with over time. Free 3 times meal. Free Accommodation. The work is to collect mainly household waste and transportation, work in waste sorting assembly line, cleaning of roads, dust and snow and at times also firefighting. Mostly the street cleaning is done by machine but sometimes manual work is also required. The usual office time will be 5am to 2pm but might change. Uniform will be provided by company', '', 0, '2019-03-06 11:47:32', '2019-03-15 17:00:00', 0, '', '2019-03-07 05:47:32', '2019-03-07 05:47:32'),
(53, 126, 'Terms and Condition  Every candidate with work permit have to come to office for personal interview and 50k have to be deposited.   Office rate is 4.25. From that 50k will be returned to agent after 3 months with 12% interest rate. Candidate will be communicated that office rate is 4.25 and anything above that office is  not liable.   Extra cost : The bank statement making charges and If Delhi invites for visa, candidates have to go at own cost. ', '', 0, '2019-03-06 11:48:03', '2019-03-15 17:00:00', 0, '', '2019-03-07 05:48:03', '2019-03-07 05:48:03'),
